import './App.css';

const App = () => {
  const name = "Harshith";
  const loggedIn = false;
  return (
    <div className="App">
      {loggedIn ? (
      <>
      <h1> Hello there! </h1>
      {name ? (
        <>
          <h2> {name} </h2>
        </>
      ) : (
        <>
          <h2> Enter a name </h2>
        </>
      )}
      </>
      ) : (
        <>
          <h1> Please login </h1>
        </>
      )}
    </div>
  );
}

export default App;
